import React, { Component } from 'react';
import Header from '../HeaderComponent/Header'
import NotificationComponent from '../NotificationComponent/NotificationComponent';
import './Dashboard.css';
import DescriptionComponent from '../DescriptionModal/DescriptionModalComponent';

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
            redirectfirst: false,
            redirectsecond: false,
        }
    }
    closeModalfirst = () => {
        this.setState({redirectfirst: false});
    }
    closeModalsecond = () => {
        this.setState({redirectsecond: false});
    }
    openModalfirst = () => {
        this.setState({redirectfirst: true});
    }
    openModalsecond = () => {
        this.setState({redirectsecond: true});
    }
    render() {
        return (
            <div className="dashboard-container">
              <Header />
              <button onClick={this.openModal}>Open</button>
              <NotificationComponent heading={"Performance Metric"} message={"The current Performance of the system is"} visible={this.state.redirect} closeModal={this.closeModal} percentage={60} />
              <DescriptionComponent heading={"The information of the redis system:"} visible={this.state.redirect} closeModal={this.closeModal} />
            </div>
        )
    }
}

export default Dashboard;
